import React from 'react';

import { Breadcrumb, Layout, Menu, theme, Table } from 'antd';
const { Header, Content, Sider } = Layout;

const dataSource = [
  {
    key: '1',
    name: 'Mike',
    age: 32,
    address: '10 Downing Street',
  },
  {
    key: '2',
    name: 'John',
    age: 42,
    address: '10 Downing Street',
  },

  {
    key: '1',
    name: 'Mike',
    age: 32,
    address: '10 Downing Street',
  },
  {
    key: '2',
    name: 'John',
    age: 42,
    address: '10 Downing Street',
  },

  {
    key: '1',
    name: 'Mike',
    age: 32,
    address: '10 Downing Street',
  },
  {
    key: '2',
    name: 'John',
    age: 42,
    address: '10 Downing Street',
  },
];

const columns = [
  {
    title: 'Name',
    dataIndex: 'name',
    key: 'name',
  },
  {
    title: 'Age',
    dataIndex: 'age',
    key: 'age',
  },
  {
    title: 'Address',
    dataIndex: 'address',
    key: 'address',
  },
];

<Table dataSource={dataSource} columns={columns} />;

function index(props) {
  return (
    <div>

      {/* {"  "} */}
      <h5>QUẢN LÝ HỆ THỐNG</h5>
      <Content
        style={{
          padding: 24,
          margin: 0,
          minHeight: 500,
          background: "#ffff",
        }}
      >

        <Table
          rowKey={(record) => record.id}
          columns={columns}
          dataSource={dataSource}
          bordered
        />
      </Content>

    </div>);
}

export default index;
